import { useState } from "react";
import { Button, Form, InputGroup } from "react-bootstrap"

function InputForm() {
    const [val, setVal] = useState()

    const onchandler = (e)=>{
        setVal(e.target.val)
    }

    const onSearch = (e) => {
        e.preventDefault()
    }
    return (
        <div>
            <InputGroup size="lg">
                <Form.Control
                    value={val}
                    onChange={onchandler}
                    aria-label="Large"
                    aria-describedby="inputGroup-sizing-sm"
                />
                <InputGroup.Text id="inputGroup-sizing-lg">
                    <Button variant="success" onClick={onSearch}>Search Item</Button>
                </InputGroup.Text>
            </InputGroup>
        </div>
    )
}
export default InputForm
